<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Dynamic Christmas Card</title>
  <style>
    /* Body and Container */
    body {
      margin: 0;
      padding: 0;
      font-family: Arial, sans-serif;
      display: flex;
      flex-direction: column;
      justify-content: center;
      align-items: center;
      height: 100vh;
      overflow: hidden; /* Prevent overflow when gifts fall */
      transition: background 0.8s ease-in-out;
      background: #000; /* Default: black for "lights off" */
    }

    .card-container {
      position: relative;
      width: 400px;
      height: 600px;
      overflow: hidden;
      border-radius: 10px;
      box-shadow: 0 4px 10px rgba(0, 0, 0, 0.2);
    }

    /* Card Images */
    .card-image {
      position: absolute;
      width: 100%;
      height: 100%;
      background-size: cover;
      background-position: center;
      transition: opacity 0.8s ease-in-out;
    }

    /* Button */
    .button-container {
      margin-top: 20px;
    }

    .toggle-button {
      padding: 10px 20px;
      font-size: 16px;
      background-color: #4CAF50;
      color: white;
      border: none;
      border-radius: 5px;
      cursor: pointer;
      transition: background-color 0.3s ease;
    }

    .toggle-button:hover {
      background-color: #45a049;
    }

    /* Falling Gifts */
    .gift {
      position: absolute;
      top: -50px; /* Start above the visible screen */
      width: 40px;
      height: 40px;
      background-size: cover;
      animation: fall 5s linear infinite;
      z-index: 1000;
    }

    @keyframes fall {
      0% {
        transform: translateY(-100%);
        opacity: 1;
      }
      100% {
        transform: translateY(100vh);
        opacity: 0;
      }
    }
  </style>
</head>

    // Initialize state
    let isLightOn = false;
    let giftInterval;

    // Toggle light effect
    toggleButton.addEventListener('click', () => {
      isLightOn = !isLightOn;

      if (isLightOn) {
        // Turn on light
        body.style.background = "linear-gradient(135deg, #ff9a9e, #fad0c4)";
        imageOn.style.opacity = '1';
        imageOff.style.opacity = '0';
        toggleButton.textContent = 'Turn Off Light';
        startFallingGifts(); // Start falling gifts
      } else {
        // Turn off light
        body.style.background = "#000";
        imageOn.style.opacity = '0';
        imageOff.style.opacity = '1';
        toggleButton.textContent = 'Turn On Light';
        stopFallingGifts(); // Stop falling gifts
      }
    });

    // Function to start falling gifts
    function startFallingGifts() {
      giftInterval = setInterval(() => {
        if (!isLightOn) return; // Ensure gifts only fall when lights are on

        const gift = document.createElement('div');
        gift.classList.add('gift');
        gift.style.left = Math.random() * 100 + 'vw';
        gift.style.animationDuration = Math.random() * 3 + 2 + 's';
        gift.style.backgroundImage = `url('${giftImages[Math.floor(Math.random() * giftImages.length)]}')`;
        gift.style.top = '-50px'; // Start the gift above the screen
        document.body.appendChild(gift);

        // Remove the gift after it falls
        gift.addEventListener('animationend', () => {
          gift.remove();
        });
      }, 300); // Generate a gift every 300ms
    }

    // Function to stop falling gifts
    function stopFallingGifts() {
      clearInterval(giftInterval);
      document.querySelectorAll('.gift').forEach((gift) => gift.remove()); // Remove existing gifts
    }
  </script>
